import React from 'react';
import "../App.css";

// A functional component for the dashboard page
function Login() {
  return (
    <div >
        <form onSubmit={handleSubmit}>
           <label htmlFor="username">Username:</label>
        </form>

      
    </div>
  );
}

export default Login;
